サーキット走行等、全開走行時にチェックランプ点灯による<br>
不調を防ぐ触媒ＫＩＴです<br>
取り付けは純正触媒と交換するだけでＯＫです<br>
確実なパワーアップが体感できるストレートパイプです<br>
伝統のＶＩＳＩＯＮ製ＨＯＮＤＡパワーを味わって下さい！<br>
材質　ステンレス<br>
 <br>
インテグラ<br>
車両型式<br>
　ＤＡ６ 
<br><br>このパーツは競技用専用パーツです。<br>装着した状態で一般公道を走行した場合、整備不良または不正改造（違法改造）で車検も不合格となります。<br><style>

