停車時に自動でＥＶモードに移行！
ハイブリッドシステムをフル活用！

【商品名】車速連動ＥＶボタン制御装置<br>
【商品詳細】<br>
■配線
■配線結線位置が記載されている取扱説明書<br>
■6カ月保証付<br><br>
<hr>
【本装置の特徴と動作仕様】
■停止時ＥＶボタンを自動的に有効にし、直ちにエンジンを停止させます。
■停止状態から走行状態に移行しても、時速約30km以上に速度が上がらない場合、エンジンは停止状態のままになります。
■車速信号確認用LEDが搭載されていますので、ひとめでわかる。
■駐車時（キーオフ時）には本機へ通電されませんので待機電力はゼロです。
■結線する配線は４本のみです。

【適合車種】プリウス<br>

【型式】NHW20系<br>
【年式】<br>
<hr>
※車両EVボタンを押した時にEVモードに移行できる状況に限り、自動でＥＶモードに移行します。
※在庫数は十分に確保するよう努めておりますが、<br>
稀に商品欠品のため納期がかかる場合がございます。<br>
お急ぎの場合はご注文前に納期お問い合わせ下さい。<br>
※現在の商品価格は発売記念価格となっております。<br>
今後変動する場合がございますのでご了承下さい。<br><br><br>







